import React from 'react'
import { FaWhatsapp } from "react-icons/fa";
import HeroSection from '../../Component/HeroSection/HeroSection'
import Products from '../../Component/Product/Products'
import Testimonial from '../../Component/Testimonial/Testimonial'
import AboutUs from '../../Component/AboutUs/AboutUs'
// import ContactUs from '../../Component/ContactUs/ContactUs'

export default function Home() {

  const phoneNumber = "91XXXXXXXXXX"; // Replace with your WhatsApp number
  const message = encodeURIComponent("Hello! I need assistance.");

  const openWhatsApp = () => {
    window.open(`https://wa.me/${phoneNumber}?text=${message}`, "_blank");
  };


  return (
    <>
     <div className="fixed bottom-4 right-4 z-50">
      <button
        onClick={openWhatsApp}
        className="bg-green-500 text-white p-3 rounded-full shadow-lg hover:bg-green-600 transition-all"
      >
        <FaWhatsapp size={30} />
      </button>
    </div>

    <div>
     <HeroSection/>
      <AboutUs/> 
      <Products/>
      {/* <ContactUs/> */}
      <Testimonial/>
      </div>

    </>
  )
}
